      jadwalData.filter(tag => {
        return tag.kompetisiName.includes(kompetisiTag.kompetisiName)
      })
    )

    return (
        <>
            <Seni getKompetisiTag={setKompetisiTag} />
            < Jadwal jadwalData={jadwalFiltered()} />
